import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import AuthService from "../services/auth-service";
const LoginPage = ({ currentUser, setCurrentUser }) => {
  const [isLogin, setIsLogin] = useState(true);
  const navigate = useNavigate();
  let [userName, setUserName] = useState("");
  let [account, setAccount] = useState("");
  let [password, setPassword] = useState("");

  let [message, setMessage] = useState("");
  const handleUserName = (e) => {
    setUserName(e.target.value);
  };
  const handleAccount = (e) => {
    setAccount(e.target.value);
  };
  const handlePassword = (e) => {
    setPassword(e.target.value);
  };
  const handleSwitchForm = () => {
    setIsLogin(!isLogin);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    // 根據 isLogin 狀態執行登入或註冊的相應邏輯
    if (isLogin) {
      // 登入邏輯
      try {
        let response = await AuthService.login(account, password);
        localStorage.setItem("user", JSON.stringify(response.data));
        window.alert("登入成功。您現在將被導向到個人頁面");
        console.log(setCurrentUser);
        setCurrentUser(AuthService.getCurrentUser());
        setMessage("");
        navigate("/profilePage");
      } catch (e) {
        setMessage(e.response.data);
      }
    } else {
      // 註冊邏輯
      AuthService.register(userName, account, password)
        .then(() => {
          setAccount("");
          setPassword("");
          setMessage("");
          window.alert("註冊成功。您現在將被導向到登入頁面");
          setIsLogin(!isLogin);
        })
        .catch((e) => {
          setMessage(e.response.data);
        });
    }
  };

  return (
    <div className="login-Container">
      <div className="container">
        <div className="controller">
          <button
            onClick={handleSwitchForm}
            disabled={!isLogin}
            style={{
              backgroundColor: "white",
              borderBottom: !isLogin ? "none" : "1px solid #ddd",
              borderRight: !isLogin ? "1px solid #ddd" : "none",
              color: !isLogin ? "#ff7b1a" : "black",
            }}
          >
            註冊會員
          </button>
          <button
            onClick={handleSwitchForm}
            disabled={isLogin}
            style={{
              backgroundColor: "white",
              borderBottom: isLogin ? "none" : "1px solid #ddd",
              borderLeft: isLogin ? "1px solid #ddd" : "none",
              color: isLogin ? "#ff7b1a" : "black",
            }}
          >
            會員登入
          </button>
        </div>

        {isLogin && <p>登入帳號</p>}

        <form onSubmit={handleSubmit}>
          {isLogin ? (
            // 登入表單內容
            <div className="userInput">
              {message && <div className="alert-error">{message}</div>}
              <input
                onChange={handleAccount}
                type="email"
                placeholder="請輸入至少6個字 "
                name="account"
                value={account}
              />

              <input
                onChange={handlePassword}
                type="password"
                name="password"
                value={password}
              />
            </div>
          ) : (
            // 註冊表單內容
            <div>
              {message && <div className="alert-error">{message}</div>}
              <label htmlFor="username">使用者名稱:</label>
              <input
                onChange={handleUserName}
                type="String"
                name="username"
                value={userName}
                required
              />
              <label htmlFor="account">帳號:</label>
              <input
                onChange={handleAccount}
                type="String"
                name="account"
                value={account}
                required
              />
              <label htmlFor="password">密碼:</label>
              <input
                onChange={handlePassword}
                type="String"
                name="password"
                value={password}
                required
              />
            </div>
          )}
          <button onClick={handleSubmit} type="submit">
            {isLogin ? "登入" : "註冊"}
          </button>
        </form>
      </div>
    </div>
  );
};

export default LoginPage;
